$(function() {
	$('a[class*=js-layerp]').bind('click', function(e) {
		e.preventDefault();
		var objHash = $(this.hash),
			backHook = $('html, body'),
			tgtClass = ($(this).attr('data-target')) ? $(this).attr('data-target') : null,
			tgtWrap = $('.document-wrap');

		objHash.addClass('active');
		backHook.addClass('mask');
		if (tgtClass !== null) tgtWrap.addClass(tgtClass);
		$('[class*=close]').bind('click', function() {
			backHook.removeClass('mask');
			objHash.removeClass('active');
			tgtWrap.removeClass(tgtClass);
		});
	});

	$('.js-toggle').bind('click', function(e) {
		e.preventDefault();
		var obj = ($(this).attr('href')) ? $(this.hash) : $(this),
			tgtClass = ($(this).attr('data-target')) ? $(this).attr('data-target') : null,
			tgtWrap = $('.document-wrap');

		obj.toggleClass('active');
		if (tgtClass !== null) tgtWrap.toggleClass(tgtClass);
		$('.close').bind('click', function() {
			obj.removeClass('active');
			tgtWrap.removeClass(tgtClass);
		});
	});

	$('.js-tab a').bind('click', function(e) {
		e.preventDefault();
		$(this).addClass('active').siblings().removeClass('active');
		$(this.hash).addClass('active').siblings().removeClass('active');
	});

	$(".js-jump").bind('click', function(e) {
		e.preventDefault();
		var tgtPos = $(this).attr('href') !== '#header' ? $(this.hash).offset().top : 0;
		$('html, body').animate({scrollTop:tgtPos}, 3e2);
	});

	$('#innerCategory .gm-catelist li > p').bind('click', function() {
		var obj = $(this).parent('li'),
			objWrap = obj.parent('ul'),
			scrollWrap = objWrap.closest('.scroll-wrap'),
			objOffset, nextScrollTop, cateId;

		if (obj.hasClass('active')) {
			obj.removeClass('active');
			return false;
		};
		if (objWrap.hasClass('depth1')) {
			$('#innerCategory').find('.active').removeClass('active');
			objOffset = obj.offset().top;
			cateId = $(this).attr('class').split('-');
			show2Depth(cateId[1]);
		} else {
			obj.siblings().removeClass('active');
			objOffset = (obj.prevAll().hasClass('active')) ? obj.offset().top - objWrap.find('.active > ul').height() : obj.offset().top;
		};
		obj.addClass('active');
		nextScrollTop = scrollWrap.scrollTop() + objOffset;
		scrollWrap.delay(150).animate({scrollTop:nextScrollTop}, 4e2);
	});

	var hDeliveryTxt = $('#header .delivery-link em').text();
	if (hDeliveryTxt.length > 5) {
		hDeliveryTxt = hDeliveryTxt.slice(0, -1);
		$('#header .delivery-link em').text(hDeliveryTxt);
	};

	$('.bestgoods-wrap-hswiper .bestgoods-list a').bind('click', function(e) {
		e.preventDefault();
		var obj = $(this).closest('li'),
			wrap = obj.closest('.bestgoods-list'),
			prevScrollLeft = wrap.scrollLeft(),
			objCenterPos = prevScrollLeft + (obj.offset().left - (wrap.width() - obj.width())/2),
			tgtHref = $(this).attr('href');

		wrap.animate({scrollLeft:objCenterPos}, 3e2);
		obj.addClass('active').siblings().removeClass('active');
	});



	var isSafari = /constructor/i.test(window.HTMLElement);
	if (!isSafari) {
		if ($('.pagenav-main').length === 0) return false;
		var wrap = $(document),
			mainStickyBar = $('.pagenav-main'),
			stickyOffsetY = mainStickyBar.offset().top;

		wrap.bind("scroll", function(e) {
			(wrap.scrollTop() > stickyOffsetY) ? mainStickyBar.addClass("sticky") : mainStickyBar.removeClass("sticky");

			var testasedrf = mainStickyBar.css('position')
			$('.pagenav-main a:nth-child(1)').text(testasedrf)
		});
	};
});
$(document).bind('scroll', function(e) {
	var docuWrap = $(document),
		btmFlotingObj = $('.floatingnav-btm'),
		btmFlotingObjPos = $(window).height();
	if (docuWrap.scrollTop() > btmFlotingObjPos) {
		btmFlotingObj.addClass('active');
	} else {
		btmFlotingObj.removeClass('active');
	}
});
